import React, { Component } from "react";
import "./Footer.css";

export default class Footer extends Component {
  render() {
    return (
      <div className="main-footer">
        <div className="container">
          <p className="college">
            {" "}
            <b>Footer</b> 
          </p>
        </div>
      </div>
    );
  }
}
